import React from 'react';
import Layout from './hoc/Layout/Layout';
import { Redirect } from 'react-router-dom';

const App = props => (
    <React.Fragment>
        <Layout>
            <p>Fuck!</p>
        </Layout>

        <Redirect from = '/' to = '/home'/>
    </React.Fragment>
);

export default App;
